//to be clear, you give it the xy position of the first and the number of each in x and y, spacing of 1 will move it over 16
void setClusterOfObstacles(int index, int obstacleIndex, int x1, int y1, int numx, int numy, int spacingx, int spacingy){
	int i = obstacleIndex;
	--numx;
	--numy;
	
	for(int y = y1; y <= (y1 + (obstacleHeight*spacingy*numy)); y+=(obstacleHeight*spacingy)){
		for(int x = x1; x <= (x1 + (obstacleWidth*spacingx*numx)); x+=(obstacleWidth*spacingx)){
			setObstacle(index, i, x, y, 0);
			++i;
		}
	}
	
}

//sets all the monsters in the dungeon, except the drops member, that will be handled seperately
void setMonsters(int index, char type){
	srand(time(0));
	
	for(int i = 0; i < theEagle[index].numOfMonsters; ++i){
		theEagle[index].listOfMonsters[i].position.x = 0;
		theEagle[index].listOfMonsters[i].position.y = 0;
	}
	
	for(int i = 0; i < theEagle[index].numOfMonsters; ++i){
		
		int x, y;
		
		//set x,y coordinates randomly if they don't overlap with obstacles in that current map
		do{
			
			//mods rand by the actual playable area, then adds the offset and the border to make values within the map
			x = (rand()%(playxsize - (2*32))) + 32 + offsetx;
			y = (rand()%(playysize - (2*32))) + 32 + offsety;	
		
		}while(checkObstacleOverlap(index, x, y) || checkMonsterOverlap(index, x, y));
		
		theEagle[index].listOfMonsters[i].position.x = x;
		theEagle[index].listOfMonsters[i].position.y = y;

		//setting the type
		theEagle[index].listOfMonsters[i].type = type;
		
		
		//if the type is a monster that has different directions
		if(type == 'g'){
			//making it randomly generate a direction to face based on the type of monster
			theEagle[index].listOfMonsters[i].position.facing = (rand()%4);
			
		} else {
			//if its not a monster that has a direction/different sprites, the direction is faces is -1
			theEagle[index].listOfMonsters[i].position.facing = -1;
			
		}
		
	}
	
}

//given an x,y position, it will return 1 if the position overlaps an obstacle
int checkObstacleOverlap(int index, int xstart, int ystart){
	
	for(int y = ystart; y <= (ystart+16); y+=16){
		for(int x = xstart; x <= (xstart + 16); x+=16){
			for(int i = 0; i < theEagle[index].numOfObstacles; ++i){
				if(abs(theEagle[index].listOfObstacles[i].x - x)  < 16 && abs(theEagle[index].listOfObstacles[i].y - y) < 16){
					return 1;
				}
			}
		}
	}
	
	return 0;
}


int checkMonsterOverlap(int index, int xstart, int ystart){
	
	for(int y = ystart; y <= (ystart+16); y+=16){
		for(int x = xstart; x <= (xstart + 16); x+=16){
			for(int i = 0; i < theEagle[index].numOfMonsters; ++i){
				if(abs(theEagle[index].listOfMonsters[i].position.x - x)  < 16 && abs(theEagle[index].listOfMonsters[i].position.y - y) < 16){
					return 1;
				}
			}
		}
	}
	
	return 0;
}


void drawDoor(int cardinal, int xstart, int ystart, uint8_t arr[]){
	int i = 0;
	
	if(cardinal <= 1){
		for(int y = 0; y < 32; ++y){
			for(int x = 0; x < 32; ++x){
				if(x >= 7 && x < 24 && y >= 16){
					pixelSet(x-7+xstart - 1,y-16+ystart,concatenate(arr[i+1], arr[i]));
				}
				i+=2;
			}
		}
	}else if (cardinal > 1){
		for(int y = 0; y < 32; ++y){
			for(int x = 0; x < 32; ++x){
				if(x <= 16 && y >= 8 && y <24){
					pixelSet(x+xstart ,y+ystart-8,concatenate(arr[i+1], arr[i]));
				}
				i+=2;
			}
		}
	}
}


void eraseDoor(int xstart, int ystart){
	for(int reset = 0; reset <= 1; ++reset){
		int i = 0;

		for(int y= 0 ; y < 16;++y){
			for(int x= 0; x< 16;++x){
				i = (2*boundsx*(ystart+y-offsety))+(2*(xstart+x-offsetx));
				pixelSet(x+xstart,y+ystart, concatenate(theEagle[currentMap].background[i+1], theEagle[currentMap].background[i]));

			}
		}
		
		//double buffering
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	}
}


