//slaughter door control
void drawSDoor(){
	int wayNum = doorOfInterest(2);
	
	if(wayNum == -1){
		return;
	}
	
	int cardinal = theEagle[currentMap].listOfWays[wayNum].cardinal;
	
	if(cardinal == 0){
		drawDoor(0, northx1, northy-16, nsSD);
		
	}else if(cardinal == 1){
		drawDoor(1, southx1, southy, nsSD);
		
	}else if(cardinal == 2){
		drawDoor(2, eastx, easty1, ewSD);
		
	}else if(cardinal == 3){
		drawDoor(3, westx-16, westy1, ewSD);
		
	}
	
}

void eraseSDoor(){
	int wayNum = doorOfInterest(2);
	
	if(wayNum == -1){
		return;
	}
	
	theEagle[currentMap].listOfWays[wayNum].doorType = 0;
	
	int cardinal = theEagle[currentMap].listOfWays[wayNum].cardinal;
	
	if(cardinal == 0){
		eraseDoor(northx1, northy-16);
		
	}else if(cardinal == 1){
		eraseDoor(southx1, southy);
		
	}else if(cardinal == 2){
		eraseDoor(eastx, easty1);
		
	}else if(cardinal == 3){
		eraseDoor(westx-16, westy1);
		
	}

}

