int checkWayEntry(int newx, int newy){
	//check if he overlaps one of the doors
		//check what cardinals there are, then check to see if link overlaps those cardinals
		
	for(int i = 0; i < theEagle[currentMap].numOfWays; ++i){
		if(theEagle[currentMap].listOfWays[i].doorType != 0){
			continue;
		}
		
		int cardinal = theEagle[currentMap].listOfWays[i].cardinal;
		
		if(cardinal == 0 && Link.facing == 1){
			//check north
			if(newx >= northx1 && newx <= northx2 && newy <= northy){
				//moves him up, changes current map, sets the exit point, draws the new background
				linkUp();
				linkUp();
				
				resetMap(i);
				
				while(Link.bottomy < playy1){
					linkDown();
				}
				
				return 1;
			}
			
		} else if(cardinal == 1 && Link.facing == 0){
			//check south
			if(newx >= southx1 && newx <= southx2 && newy >= southy){
				
				linkDown();
				linkDown();
				
				resetMap(i);
				
				while(Link.bottomy > playy2){
					linkUp();
				}
					
				return 1;
			}
			
		} else if (cardinal == 2 && Link.facing == 2){
			//check east
			if(newx >= eastx && newy >= easty1 && newy <= easty2){
				linkLeft();
				linkLeft();
				
				resetMap(i);
				
				while(Link.bottomx < playx1){
					linkLeft();
				}
				
				return 1;
			
			}
		} else if (cardinal == 3 && Link.facing == 3){
			//check west
			if(newx <= westx && newy >= westy1 && newy <= westy2){
				linkRight();
				linkRight();
				resetMap(i);
				
				while(Link.bottomx > playx2){
					linkRight();
				}
				
				return 1;
			}
		}
	}

	return 0;
}

void resetMap(int i){
	currentMapExit = theEagle[currentMap].listOfWays[i].exitWay;
	currentMap = theEagle[currentMap].listOfWays[i].exit;
	
	clearScreen();
	drawWorld();
	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	
	clearScreen();
	drawWorld();
	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	
	
	//update links position based on exitWay, updatePositionx3
	int cardinal = theEagle[currentMap].listOfWays[currentMapExit].cardinal;
	
	if(cardinal == 0){
		//check north
		Link.x = northx1;
		Link.y = northy;
		Link.facing = 1;
		
	} else if(cardinal == 1){
		//check south
		Link.x = southx1;
		Link.y = southy;
		Link.facing = 0;

	} else if (cardinal == 2){
		//check east
		Link.x = eastx;
		Link.y = easty1;
		Link.facing = 2;

	} else if (cardinal == 3){
		//check west
		Link.x = westx;
		Link.y = westy1;
		Link.facing = 3;

	}

	updatePosition(0,0);	
	updatePosition(0,0);
	updatePosition(0,0);
	
	
	for(int i = 0; i < theEagle[currentMap].numOfMonsters; ++i){
		drawMonster(theEagle[currentMap].listOfMonsters[i]);
	}
	
	
}
	
	